// components/Sidebar.js
import React from 'react';
import { HomeIcon, InfoIcon, SettingsIcon } from '@heroicons/react/16/solid'; // Import icons from Heroicons or any icon library you're using

const Sidebar = () => {
  return (
    <div className="w-64 h-screen bg-gray-800 text-white fixed">
      <div className="p-5">
        <h2 className="text-2xl font-semibold">Breast Cancer</h2>
      </div>
      <nav className="mt-10">
        <a href="#home" className="flex items-center text-gray-400 hover:bg-gray-700 hover:text-white py-2 px-4">
          <HomeIcon className="h-5 w-5 mr-3" />
          <span>Home</span>
        </a>
        <a href="#about" className="flex items-center text-gray-400 hover:bg-gray-700 hover:text-white py-2 px-4">
          <InfoIcon className="h-5 w-5 mr-3" />
          <span>About</span>
        </a>
        <a href="#settings" className="flex items-center text-gray-400 hover:bg-gray-700 hover:text-white py-2 px-4">
          <SettingsIcon className="h-5 w-5 mr-3" />
          <span>Settings</span>
        </a>
      </nav>
    </div>
  );
};

export default Sidebar;
